            JArray newJa = new JArray();
            JArray newJa_Final = new JArray();

            //Char delimiter = ',';

            string project_id = "";
            if (Data.project_id != null) { project_id = APCommonFun.CDBNulltrim(Data.project_id); }

            if(project_id.Length <= 0)
            {
                return APCommonFun.ReturnError(mStrFuncName, "No project_id is specified.", "R", new JArray());
            }

            OracleConnection conn = APCommonFun.GetOracleConnection();
            if (conn == null)
            {
                return APCommonFun.ReturnError(mStrFuncName, "Oracle connecting fault.", "F", new JArray());
            }
            string sqlcommand = string.Format("select filep,filep1 from zcpst11 where pspnr = '{0}'", project_id);

            OracleCommand cmd = new OracleCommand(sqlcommand, conn);
            cmd.CommandType = CommandType.Text;
            DataSet _ds = new DataSet();
            int _rec_count = 0;
            try
            {
                OracleDataAdapter _da = new OracleDataAdapter();
                _da.SelectCommand = cmd;
                _rec_count = _da.Fill(_ds);
                string apiPath = Startup.ReadFromAppSettings("ApiPath");  //ip

                switch (_rec_count)
                {
                    case 0:
                        try { conn.Close(); } catch { }
                        return APCommonFun.ReturnError(mStrFuncName, string.Format("{0} has no record.", project_id), "F", new JArray());
                    case 1:
                        string info_filepath = _ds.Tables[0].Rows[0]["filep1"] == null ? "" : _ds.Tables[0].Rows[0]["filep1"].ToString().Trim().Trim();
                        string img_filepath = _ds.Tables[0].Rows[0]["filep"] == null ? "" : _ds.Tables[0].Rows[0]["filep"].ToString().Trim();

                        JObject tmpJoLay02 = new JObject();
                        
                        if (info_filepath.Length > 0)
                        {

                            using (HttpClientHandler handler = new HttpClientHandler())
                            {
                                using (HttpClient client = new HttpClient(handler))
                                {
                                    #region 呼叫遠端 Web API
                                    string FooUrl = apiPath;
                                    HttpResponseMessage response = null;

                                    #region  設定相關網址內容
                                    var fooFullUrl = $"{FooUrl}{info_filepath}";

                                    response = await client.GetAsync(fooFullUrl);
                                    #endregion
                                    #endregion
                                    
                                    #region 處理呼叫完成 Web API 之後的回報結果
                                    if (response != null)
                                    {
                                        if (response.IsSuccessStatusCode == true)
                                        {
                                            Guid guid = Guid.NewGuid();
                                            string folder = "XingUpdateFile\\" + guid.ToString();
                                            using (var filestream = System.IO.File.Open(folder, FileMode.OpenOrCreate, FileAccess.ReadWrite))
                                            {
                                                using (var stream = await response.Content.ReadAsStreamAsync())
                                                {
                                                    stream.CopyTo(filestream);
                                                }
                                            }

                                            string _content = APCommonFun.ReadFileContent(folder);
                                            bool isFileExist = System.IO.File.Exists(folder);
                                            if (isFileExist)
                                            {
                                                if (_content.Length > 0)
                                                {
                                                    tmpJoLay02.Add(new JProperty("info", _content.Replace("\r\n", "<br>")));
                                                }
                                                else
                                                {
                                                    tmpJoLay02.Add(new JProperty("info", "No data."));
                                                }
                                            }
                                            else
                                            {
                                                tmpJoLay02.Add(new JProperty("info", "沒有摘要檔案"));
                                            }
                                        }
                                        else
                                        {
                                            try { conn.Close(); } catch { }
                                            return APCommonFun.ReturnError(mStrFuncName, "Common exception", string.Format("Error Code:{0}, Error Message:{1}", response.StatusCode, response.RequestMessage), "F", new JArray());
                                        }
                                    }
                                    else
                                    {
                                        try { conn.Close(); } catch { }
                                        return APCommonFun.ReturnError(mStrFuncName, "Common exception", "應用程式呼叫 API 發生異常", "F", new JArray());
                                    }
                                    #endregion
                                }
                            }                            
                        }
                        else
                        {
                            tmpJoLay02.Add(new JProperty("info", "No file."));
                        }

                        if (img_filepath.Length > 0)
                        {

                            using (HttpClientHandler handler = new HttpClientHandler())
                            {
                                using (HttpClient client = new HttpClient(handler))
                                {
                                    #region 呼叫遠端 Web API
                                    string FooUrl = apiPath;
                                    HttpResponseMessage response = null;

                                    #region  設定相關網址內容
                                    var fooFullUrl = $"{FooUrl}{img_filepath}";

                                    response = await client.GetAsync(fooFullUrl);
                                    #endregion
                                    #endregion

                                    #region 處理呼叫完成 Web API 之後的回報結果
                                    if (response != null)
                                    {
                                        if (response.IsSuccessStatusCode == true)
                                        {
                                            Guid guid = Guid.NewGuid();
                                            string folder = "XingUpdateFile\\" + guid.ToString();
                                            using (var filestream = System.IO.File.Open(folder, FileMode.OpenOrCreate, FileAccess.ReadWrite))
                                            {
                                                using (var stream = await response.Content.ReadAsStreamAsync())
                                                {
                                                    stream.CopyTo(filestream);
                                                }
                                            }

                                            string _content = APCommonFun.ReadImageFileToBase64(folder);
                                            bool isFileExist = System.IO.File.Exists(folder);
                                            if (isFileExist)
                                            {
                                                if (_content.Length > 0)
                                                {
                                                    tmpJoLay02.Add(new JProperty("pic", _content));
                                                }
                                                else
                                                {
                                                    tmpJoLay02.Add(new JProperty("pic", "No image content."));
                                                }
                                            }
                                            else
                                            {
                                                tmpJoLay02.Add(new JProperty("pic", "沒有圖片檔"));
                                            }
                                        }
                                        else
                                        {
                                            try { conn.Close(); } catch { }
                                            return APCommonFun.ReturnError(mStrFuncName, "Common exception", string.Format("Error Code:{0}, Error Message:{1}", response.StatusCode, response.RequestMessage), "F", new JArray());
                                        }
                                    }
                                    else
                                    {
                                        try { conn.Close(); } catch { }
                                        return APCommonFun.ReturnError(mStrFuncName, "Common exception", "應用程式呼叫 API 發生異常", "F", new JArray());
                                    }
                                    #endregion
                                }
                            }

                            
                        }
                        else
                        {
                            tmpJoLay02.Add(new JProperty("pic", "No image file."));
                        }

                        try { conn.Close(); } catch { }
                        return new
                        {
                            Result = "T",
                            Message = "成功",
                            Data = tmpJoLay02
                        };
                        
                    default:
                        try { conn.Close(); } catch { }
                        return APCommonFun.ReturnError(mStrFuncName, string.Format("{0} has more than 2 records.", project_id), "R", new JArray());
                }
            }
            catch (Exception ex)
            {
                try { conn.Close(); } catch { }
                return APCommonFun.ReturnError(mStrFuncName, "Common exception", ex.ToString(), "F", new JArray());
            }

